import './Square.css';
import React from 'react';

class Square extends React.Component {
  render(){
    const classes = "square" + (this.props.isDark ? " dark" : " light");
    return (
      <td className={classes} onClick={this.handleClick}>
        <img src="./images/b_k.png"></img>
        <p>{this.props.piece}</p>
      </td>
    );
  }
}

export default Square;
